import React, { Component } from 'react';
import Slider from "react-slick";
import { Card } from 'antd';

const { Meta } = Card;

class Case extends Component {
    render() {
        const slider_adopt = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 3,
            slidesToScroll: 3
        };
        return (
            <section className="top-products">
                <div className="container">
                    <h1 className="section-heading">Adoption</h1>
                    <div class="slider-adoption">
                        <Slider className="food-slider" {...slider_adopt}>
                        <div className="food-card magic-shadow-sm" style={{ width: 60 }}>
                            <div className="product-image flex items-center justify-center">
                                <img src="https://res.cloudinary.com/lucy123/image/upload/v1609064179/test/vravk16zxbeujjz55utv.png" alt />
                            </div>

                        </div>
                        <div className="food-card magic-shadow-sm">
                            <div className="product-image flex items-center justify-center">
                                <img src="https://res.cloudinary.com/lucy123/image/upload/v1609064122/test/a4vpdhuurrjgzndn38o6.jpg" alt />
                            </div>
                        </div>
                        <div className="food-card magic-shadow-sm">
                            <div className="product-image flex items-center justify-center">
                                <img src="https://res.cloudinary.com/lucy123/image/upload/v1609698146/test/izbn93tcum1ljnwfntfd.jpg" alt />
                            </div>
                        </div>
                        <div className="food-card magic-shadow-sm">
                            <div className="product-image flex items-center justify-center">
                                <img src="https://res.cloudinary.com/lucy123/image/upload/v1609698146/test/izbn93tcum1ljnwfntfd.jpg" alt />
                            </div>
                        </div>
                        </Slider>
                    </div>
                </div>
            </section>
        );
    }
}


export default Case;
